import React, {useState} from 'react'
import { TextField, Button, Typography, Paper } from '@material-ui/core'

function Form() {
    const [postData, setPostData] = useState({creator: '', message: '', tags: '', selectedFile: ''}); 
    const classes = useStlyes();


    const handleSubmit = () => {

    }

    return (
       <paper class= {classes.paper}>
           <form autoComplete = "off" noValidate className={classes.form} onSubmit={handleSubmit}>
            <Typography variant="h6">Welcome to my portfolio, while your here create a memory..</Typography>
           <TextField name="creator" variant="outlined" label="Creator" fullWidth value={postData.creator} onChange={(e) => setPostData({ ...postData, creator: e.target.value })} /> 
           <TextField name="title" variant="outlined" label="Title" fullWidth value={postData.creator} onChange={(e) => setPostData({ ...postData, creator: e.target.value })} /> 
           <TextField name="message" variant="outlined" label="Message" fullWidth value={postData.creator} onChange={(e) => setPostData({ ...postData, creator: e.target.value })} /> 
           <TextField name="tags" variant="outlined" label="Creator" fullWidth value={postData.creator} onChange={(e) => setPostData({ ...postData, creator: e.target.value })} /> 
           </form>
       </paper>
    );
}

export default Form;
